import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

const Expenses = (props) => {
  return (
    <div className="expenses">
      <ExpenseItem
        title={props.expenses[0].title}
        date={props.expenseItem1.date}
        amount={props.expenseItem1.amount}
      />
      <ExpenseItem
        title={props.expenseItem2.title}
        date={props.expenseItem2.date}
        amount={props.expenseItem2.amount}
      />
    </div>
  );
};

export default Expenses;
